import React from 'react';
import styled, { css } from 'styled-components';
import { MdDone, MdDelete } from 'react-icons/md';

const TodoItem = () => {
	return (
		<Wrapper>
			<CheckCircle>
				<MdDone />
			</CheckCircle>
			<Text>text</Text>
			<Remove>
				<MdDelete />
			</Remove>
		</Wrapper>
	);
};

const Remove = styled.div`
	display: flex;
	align-items: center;
	justify-content: center;
	color: #dee2e6;
	font-size: 24px;
	cursor: pointer;
`;

const Wrapper = styled.div`
	display: flex;
	align-items: center;
	padding: 12px 0;
`;

const CheckCircle = styled.div`
	width: 32px;
	height: 32px;
	display: flex;
	align-items: center;
	justify-content: center;
	margin-right: 20px;
	border: 1px solid #ced4da;
	border-radius: 16px;
	font-size: 24px;
	cursor: pointer;
`;

const Text = styled.div`
	flex: 1;
	font-size: 21px;
	color: #495057;
`;

export default TodoItem;
